import React from 'react';
import InfoSection from './InfoSection.js';

function Body() {
	return (
		<div className="body">
			<body> 
				<InfoSection 
					details={{title: "Kits", text: "tbd"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
				]<InfoSection 
					details={{title: "Renders", text: "abcd.ca"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
				<InfoSection 
					details={{title: "Vendor", text: "abcd.ca"}}
				/>
			</body>
		</div>
	);
}

export default Body;
